import React, { useEffect } from 'react';
import './ProjectsPage.css';

const ProjectsPage = () => {
    const projects = [
        {
            name: 'Project One',
            imageUrl: 'path/to/project1.jpg',
            githubUrl: 'https://github.com/user/project1'
        },
        {
            name: 'Project Two',
            imageUrl: 'path/to/project2.jpg',
            githubUrl: 'https://github.com/user/project2'
        },
        {
            name: 'Project Three',
            imageUrl: 'path/to/project3.jpg',
            githubUrl: 'https://github.com/user/project3'
        }
    ];

    useEffect(() => {
        const projectCards = document.querySelectorAll('.project-card');
        projectCards.forEach((card, index) => {
            setTimeout(() => {
                card.style.opacity = 1;
                card.style.transform = 'translateY(0)';
            }, index * 100);
        });
    }, []);

    return (
        <div className="projects-page">
            <h1>My Projects</h1>
            <div className="projects-container">
                {projects.map((project, index) => (
                    <div key={index} className="project-card" onClick={() => window.open(project.githubUrl, '_blank')}>
                        <img src={project.imageUrl} alt={project.name} className="project-image" />
                        <h2>{project.name}</h2>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default ProjectsPage;
